import React from "react";
import HomeDiv from "../styledComponents";
import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();
  const goTest = () => {
    navigate("/test");
  }; // eslint-disable-next-line

  return (
    <>
      <HomeDiv>
        <h1>Deep Sleep</h1>
        <button type="button" onClick={goTest}>
          Start
        </button>
      </HomeDiv>
    </>
  );
};

export default Home;
